import React, { useState } from 'react';

const Home = () => {
  const [searchTerm, setSearchTerm] = useState('');
  const [filter, setFilter] = useState('');
  const [currentPage, setCurrentPage] = useState(1);
  const [itemsPerPage, setItemsPerPage] = useState(5); // 예를 들어 페이지 당 5개 아이템을 표시

  const dummyData = [
    { issueNum: 1, title: 'Issue 1', reportedDate: '2023-05-01', assignee: 'John Doe', status: 'Open' },
    { issueNum: 2, title: 'Issue 2', reportedDate: '2023-05-02', assignee: 'Jane Smith', status: 'Closed' },
    { issueNum: 3, title: 'Issue 3', reportedDate: '2023-05-03', assignee: 'Mike Johnson', status: 'Open' },
    { issueNum: 4, title: 'Issue 4', reportedDate: '2023-05-04', assignee: 'Sara White', status: 'Closed' },
    { issueNum: 5, title: 'Issue 5', reportedDate: '2023-05-05', assignee: 'Paul Brown', status: 'Open' },
    { issueNum: 6, title: 'Issue 6', reportedDate: '2023-05-06', assignee: 'Nancy Green', status: 'Open' },
    { issueNum: 7, title: 'Issue 7', reportedDate: '2023-05-07', assignee: 'Peter Blue', status: 'Closed' },
    { issueNum: 8, title: 'Issue 8', reportedDate: '2023-05-08', assignee: 'Lucy Grey', status: 'Open' },
    { issueNum: 9, title: 'Issue 9', reportedDate: '2023-05-09', assignee: 'Tom Black', status: 'Closed' },
    { issueNum: 10, title: 'Issue 10', reportedDate: '2023-05-10', assignee: 'Hank Black', status: 'Open' },
  ];

  // 검색 및 필터링된 데이터를 반환
  const filteredData = dummyData.filter(issue => {
    return (
      (issue.title.toLowerCase().includes(searchTerm.toLowerCase()) || 
      issue.assignee.toLowerCase().includes(searchTerm.toLowerCase())) &&
      (filter === '' || issue.status === filter)
    );
  });

  // 현재 페이지의 데이터를 계산
  const indexOfLastItem = currentPage * itemsPerPage;
  const indexOfFirstItem = indexOfLastItem - itemsPerPage;
  const currentItems = filteredData.slice(indexOfFirstItem, indexOfLastItem);

  // 페이지 번호를 렌더링하기 위한 로직
  const pageNumbers = [];
  for (let i = 1; i <= Math.ceil(filteredData.length / itemsPerPage); i++) {
    pageNumbers.push(i);
  }

  return (
    <div className="p-4">
      <h1 className="text-left text-2xl mb-4">ISSUE</h1>
      <div className="mb-4">
        <input
          type="text"
          placeholder="Search..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
          className="border p-2 mr-2"
        />
        <select value={filter} onChange={(e) => setFilter(e.target.value)} className="border p-2">
          <option value="">All</option>
          <option value="Open">Open</option>
          <option value="Closed">Closed</option>
        </select>
      </div>

      <div className="overflow-x-auto">
        <table className="min-w-full bg-white">
          <thead>
            <tr>
              <th className="px-4 py-2">Issue Number</th>
              <th className="px-4 py-2">Title</th>
              <th className="px-4 py-2">Reported Date</th>
              <th className="px-4 py-2">Assignee</th>
              <th className="px-4 py-2">Status</th>
            </tr>
          </thead>
          <tbody>
            {currentItems.map((issue, index) => (
              <tr key={index}>
                <td className="border px-4 py-2">{issue.issueNum}</td>
                <td className="border px-4 py-2">{issue.title}</td>
                <td className="border px-4 py-2">{issue.reportedDate}</td>
                <td className="border px-4 py-2">{issue.assignee}</td>
                <td className="border px-4 py-2">{issue.status}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
      <div className="flex justify-center mt-4">
        {pageNumbers.map(number => (
          <a key={number} onClick={() => setCurrentPage(number)} className="mx-1 px-4 py-2 border rounded cursor-pointer">
            {number}
          </a>
        ))}
      </div>
    </div>
  );
};

export default Home;
